import React from 'react';

const nytlogo = 'https://developer.nytimes.com/files/poweredby_nytimes_150b.png?v=1583354208366';
const nyturl = 'https://developer.nytimes.com/'

const Footer = (props) => {
    return (
        <footer className="page-footer font-small blue pt-4">
            <div className="footer-copyright text-center py-3"><a href={nyturl}> <img src={nytlogo}/></a> <a
                href="https://github.com/sylleryum"> https://github.com/sylleryum</a>
            </div>
        </footer>
    );
};

export default Footer;
